import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('dejavu-sans-normal.ttf', font);
this.addFont('dejavu-sans-normal.ttf', 'dejavu-sans', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
window.DejaVuSans = "base64 ile encode edilmiş ttf içeriği";
